5af401e4-4f35-45a8-b112-b274c107a4fd	<p>Ovasave, a Hub71 Femtech startup focused on fertility and hormonal health, has successfully completed its pre-seed round, raising $1.2 million from a mix of regional and international investors. The round was led by PlusVC, Annex Investments, and New York-based 25 Madison, with additional backing from UAE and Saudi-based strategic angel investors and prominent family offices. This reflects the strong investors‚Äô confidence and growing demand for innovation in women‚Äôs health across the region.</p><p>Founded in 2023, Ovasave offers women a seamless, digital-first experience for fertility testing, egg freezing, hormone management, and menopause care. The platform combines at-home hormone testing, virtual consultations, personalised supplement protocols, and access to top fertility clinics for fertility preservation (egg freezing). Positioned as disruptors in fertility and women‚Äôs hormonal health, Ovasave has also established a growing corporate benefits scheme that helps organisations support employees‚Äô reproductive health as part of their workplace wellbeing programmes.</p><p>The $1.2 million capital raised will be used to support regional expansion across the GCC, scale corporate partnerships, and launch the next phase of Ovasave‚Äôs mobile app, which will include menstrual cycle tracking, symptom monitoring, access to care, and AI-driven treatment protocols. Ovasave will also address a historically overlooked stage of women‚Äôs health, offering a broader range of services targeting perimenopause and menopause.</p><p>The raise comes as the UAE accelerates national reforms in healthcare and women‚Äôs rights, offering a timely window for FemTech innovation. Ovasave is registered with the Department of Health ‚Äì Abu Dhabi and supported by Abu Dhabi‚Äôs global tech ecosystem, Hub71, further aligning it with the nation‚Äôs broader digital and preventive health strategies.</p><p>Majd Abu Zant, co-founder of Ovasave and global leader in fertility and women‚Äôs healthcare, said, ‚ÄúAbu Dhabi‚Äôs focus on innovation, healthcare, and entrepreneurship has created a competitive environment for founders and investors alike. As an Abu Dhabi-based startup supported by Hub71, Ovasave has benefited from a strong regulatory framework, access to capital, and proximity to regional decision-makers. It‚Äôs the right environment to build and scale high-impact ventures, and from here, we are expanding into Saudi Arabia and the wider MENA region.‚Äù</p><p>A recent report by FemTech Analytics (FTA) revealed that the FemTech market in the MENA region is projected to reach $3.8 billion by 2031, growing at a CAGR of 15% during the forecast period from 2021 to 2031. (source: FTA Study, 2021)&nbsp;</p><p>‚ÄúOverall, FemTech in the UAE is still in its early stages, but the momentum is clear. With increasing investor interest and a strong national focus on women‚Äôs health and innovation, the UAE is emerging as a regional hub for the growth of this sector,‚Äù Abu Zant added.</p><p>Torkia Mahloul, co-founder and CEO of Ovasave, said, "There is a critical need for timely intervention in women‚Äôs health, particularly around fertility and hormonal health. This funding marks a crucial step in our mission to disrupt women‚Äôs health and expand access to fertility and hormonal care across the region. We are grateful for the confidence shown by our investors, which allows us to scale a platform designed to deliver timely, personalised, and accessible fertility and hormonal care. By bringing together medical expertise, digital convenience, and emotional support, we are helping women take control of their health earlier and more effectively across different life stages.‚Äù</p><p>Built with a clear purpose, Ovasave is shifting women‚Äôs care from reactive to proactive. Its solutions are designed to reduce costs, improve outcomes, and make it easier for women to access support in an area that has long been considered taboo and under-discussed.</p><p>Moreover, Ovasave has embedded public education into its core mission, organising awareness events and expert talks and collaborating with physicians to normalise fertility conversations. One of its standout initiatives was the ‚ÄúFertility Your Way‚Äù campaign with Merck Gulf, offering free AMH screenings across the UAE. More than 500 women were screened during the campaign. The startup also partnered with leading employers including Aldar, Boston Consulting Group, and WeWork to raise awareness of fertility in the workplace. Through these efforts, Ovasave is helping shift the narrative on reproductive health across the region.</p><p>"With investor confidence and strong market demand, the conversation around women‚Äôs health is changing, signalling that fertility and hormonal care are no longer peripheral issues. Women‚Äôs health is now a priority for innovation and investment in the Middle East, and we are proud to be leading that change,‚Äù Mahloul concluded.&nbsp;</p><p>Ovasave‚Äôs fundraising comes amid growing investor interest in women‚Äôs health and fertility innovation across the MENA region. With a $1.2 million&nbsp;pre-seed round now closed, Ovasave is expanding operations to Saudi Arabia this summer, with broader regional growth across MENA being part of their three-year expansion strategy.</p>	{"type": "doc", "content": [{"type": "paragraph", "content": [{"text": "Ovasave, a Hub71 Femtech startup focused on fertility and hormonal health, has successfully completed its pre-seed round, raising $1.2 million from a mix of regional and international investors. The round was led by PlusVC, Annex Investments, and New York-based 25 Madison, with additional backing from UAE and Saudi-based strategic angel investors and prominent family offices. This reflects the strong investors‚Äô confidence and growing demand for innovation in women‚Äôs health across the region.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "Founded in 2023, Ovasave offers women a seamless, digital-first experience for fertility testing, egg freezing, hormone management, and menopause care. The platform combines at-home hormone testing, virtual consultations, personalised supplement protocols, and access to top fertility clinics for fertility preservation (egg freezing). Positioned as disruptors in fertility and women‚Äôs hormonal health, Ovasave has also established a growing corporate benefits scheme that helps organisations support employees‚Äô reproductive health as part of their workplace wellbeing programmes.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "The $1.2 million capital raised will be used to support regional expansion across the GCC, scale corporate partnerships, and launch the next phase of Ovasave‚Äôs mobile app, which will include menstrual cycle tracking, symptom monitoring, access to care, and AI-driven treatment protocols. Ovasave will also address a historically overlooked stage of women‚Äôs health, offering a broader range of services targeting perimenopause and menopause.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "The raise comes as the UAE accelerates national reforms in healthcare and women‚Äôs rights, offering a timely window for FemTech innovation. Ovasave is registered with the Department of Health ‚Äì Abu Dhabi and supported by Abu Dhabi‚Äôs global tech ecosystem, Hub71, further aligning it with the nation‚Äôs broader digital and preventive health strategies.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "Majd Abu Zant, co-founder of Ovasave and global leader in fertility and women‚Äôs healthcare, said, ‚ÄúAbu Dhabi‚Äôs focus on innovation, healthcare, and entrepreneurship has created a competitive environment for founders and investors alike. As an Abu Dhabi-based startup supported by Hub71, Ovasave has benefited from a strong regulatory framework, access to capital, and proximity to regional decision-makers. It‚Äôs the r