ore mission, organising awareness events and expert talks and collaborating with physicians to normalise fertility conversations. One of its standout initiatives was the ‚ÄúFertility Your Way‚Äù campaign with Merck Gulf, offering free AMH screenings across the UAE. More than 500 women were screened during the campaign. The startup also partnered with leading employers including Aldar, Boston Consulting Group, and WeWork to raise awareness of fertility in the workplace. Through these efforts, Ovasave is helping shift the narrative on reproductive health across the region.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "\\"With investor confidence and strong market demand, the conversation around women‚Äôs health is changing, signalling that fertility and hormonal care are no longer peripheral issues. Women‚Äôs health is now a priority for innovation and investment in the Middle East, and we are proud to be leading that change,‚Äù Mahloul concluded.¬†", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "Ovasave‚Äôs fundraising comes amid growing investor interest in women‚Äôs health and fertility innovation across the MENA region. With a $1.2 million¬†pre-seed round now closed, Ovasave is expanding operations to Saudi Arabia this summer, with broader regional growth across MENA being part of their three-year expansion strategy.", "type": "text"}]}]}	\N	\N	\N	\N
da172c9d-bdb5-44c2-b7c5-2b5e82b342d2	<p>After a long career with EY and leadership positions in SMBs, I decided to set up my own small business and quickly realised that a career in the corporate world doesn‚Äôt prepare you for small business life. You have to handle everything yourself. Sorting through countless tools, I soon saw that I didn‚Äôt need a bazooka to kill a mosquito.</p><p>Small businesses generally run their Ô¨Ånances, HR, and operations with a ‚ÄúSwiss army knife‚Äù admin person, but these multi-taskers aren‚Äôt great at handling Ô¨Ånancial management.</p><p>Managing Ô¨Ånances is often seen as the most daunting aspect of running a small business. The intricacies of accounting practices, compliance demands, and potential penalties make it easy to understand why many small business owners feel overwhelmed and sometimes delay these tasks. This can also be attributed to avoiding something perceived as boring and not part of the core activity.</p><p>While all this rings true, how do you stay on top of your Ô¨Ånances without breaking the bank or burning the midnight oil?</p><p>Elon Musk would say, break anything difficult down to its Ô¨Årst principles. So, let‚Äôs break down a micro-business‚Äôs accounting process into just six basic steps:</p><ol><li><p><strong>Sales and Invoicing. </strong>Generating accurate invoices and tracking sales is fundamental to maintaining your revenue stream.</p></li><li><p><strong>Expenses and Purchases. </strong>Keeping a meticulous record of expenditures is crucial for monitoring the Ô¨Ånancial health of your business.</p></li><li><p><strong>Payments and Receipts. </strong>Efficient handling of incoming and outgoing payments ensures the business maintains a healthy cash Ô¨Çow.</p></li><li><p><strong>Bookkeeping. </strong>Regular updates to the proÔ¨Åt &amp; loss statements, balance sheets, and cash Ô¨Çow statements are essential for a clear Ô¨Ånancial overview and ensuring compliance.</p></li><li><p><strong>Tax Compliance. </strong>Awareness and adherence to tax obligations prevent legal complications and potential Ô¨Ånes.</p></li></ol><p>As long as you are on top of these steps, you can rest easy that the basics are covered.</p><p>Then, the below will ensure peace of mind and enhance your ability to fully understand your business.</p><p><strong>Keep Personal &amp; Business Expenses Separate</strong></p><p>Many small business owners, especially single owners, treat their business as an extension of themselves. The tendency to mix personal and business expenses is common. We‚Äôve seen quite a few Zara bills on many a client.</p><p>Discipline is necessary, especially with the corporate tax coming. Many expense categories are not fully reimbursable or may even be disallowed.</p><p>It‚Äôs a good practice to maintain a corporate bank account even if you‚Äôre just starting. New-age banks such as Wio were established to Ô¨Åll the gap in the market where ultra-small businesses without an office and adequate turnover can maintain a proper bank account.</p><p><strong>Keep Records</strong></p><p>While the FTA doesn‚Äôt require you to use software, it is important to maintain records for Ô¨Åve years, and software can help. Popular options like QuickBooks, Zoho, and Xero offer relatively inexpensive subscriptions from AED 65-75 per month.</p><p>Importantly, assess what‚Äôs best for you instead of picking software because of a freebie like a free licence for a year.</p><p>You could also adopt something like <a rel="noopener noreferrer nofollow" href="http://Paci.ai">Paci.ai</a>, which deÔ¨Ånes itself as software with a service. Each subscription comes with a dedicated accountant, ensuring last-mile Ô¨Ånance management. This means all you have to do is drag and drop your documents‚Äî invoices, expenses, receipts, and bank statements. Paci‚Äôs software ensures all entries are classiÔ¨Åed, categorised, and tallied, and taxes are Ô¨Åled.</p><p><strong>Track Important Numbers</strong></p><p>Many small business owners know their numbers off the back of a napkin, but it‚Äôs still imperative to track important numbers, especially cash Ô¨Çow.</p><p>While this diÔ¨Äers from industry to industry, keep an eye on the basics: income, expenses, proÔ¨Åts, cash Ô¨Çow, top customers, top expenses, top income contributors, and trends. This ensures not only basic health checks but can also act as a catalyst for growth.</p><p><strong>Review Financials</strong></p><p>Understand the holy triumvirate of the income statement, balance sheet, and cash Ô¨Çow. While many businesses understand the income statement or proÔ¨Åt &amp; loss statement, small businesses often overlook the balance sheet and cash Ô¨Çow.</p><p>A balance sheet is crucial as it outlines the state of a business at any point in time. A cash Ô¨Çow statement provides details on the sources of cash for the business, usually from three sources: operating activities, investing activities, and Ô¨Ånancing activities.</p><p><strong>Keep an Eye on Compliances and Their Potential Penalties</strong></p><p>ESR for small businesses ensures that you engage in substantial activities in your jurisdiction. Relevant activities under ESR include banking, insurance, investment fund management, lease Ô¨Ånance, headquarters, shipping, holding company, intellectual property, and distribution and service centres. These categories must demonstrate substantial activities as deÔ¨Åned by regulatory authorities. Typical penalties for omissions and errors mean having tighter oversight or additional help with Ô¨Ånances is worthwhile.</p><p><strong>Nice to Have: Budgeting</strong></p><p>Consider how every change in expenses or income will trickle down to your budget. Hiring a new employee doesn‚Äôt just mean another salary; it also translates to changes in payroll taxes, beneÔ¨Åts, and other expenses.</p><p>Ensure you‚Äôre budgeting for all expense categories, including Ô¨Åxed, variable, and emergency expenses. Anticipating these costs can help you balance your business budget and plan ahead. View your business budget as a living document. Financial circumstances change, and the unexpected happens. Review your Ô¨Ånancial statements regularly, reconsider your costs and spending, and reÔ¨Åne your business budget as necessary.</p><p>Set goals but avoid wishful thinking. Use your bookkeeping records to determine what might transpire over the next month, quarter, or year. Ultimately, it‚Äôs better to be conservative with your budget than to expect the best-case scenario.</p><p><strong>Make Technology Your Friend, but not a Crutch</strong></p><p>Follow the KISS (Keep it Simple, Stupid) principle. With numerous tools like accounting software, banking apps, payment gateways, CRM software, expense cards, e-commerce stores, and super apps, it‚Äôs tempting to automate everything. However, this can create a false sense of security and lead to ballooning costs after the trial periods end.</p><p>Keep it simple, understand your core activities, and use a tool stack that does enough and does it well.</p>	{"type": "doc", "content": [{"type": "paragraph", "content": [{"text": "After a long career with EY and leadership positions in SMBs, I decided to set up my own small business and quickly realised that a career in the corporate world doesn‚Äôt prepare you for small business life. You have to handle everything yourself. Sorting through countless tools, I soon saw that I didn‚Äôt need a bazooka to kill a mosquito.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "Small businesses generally run their Ô¨Ånances, HR, and operations with a ‚ÄúSwiss army knife‚Äù admin person, but these multi-taskers aren‚Äôt great at handling Ô¨Ånancial management.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "Managing Ô¨Ånances is often seen as the most daunting aspect of running a small business. The intricacies of accounting practices, compliance demands, and potential penalties make it easy to understand why man