y of resources, training options, and mentors available, and you can improve anything with enough practice. Personally, if I am scared of doing something, I force myself to keep doing it until it becomes second nature. Plus, you can always outsource certain tasks requiring specific expertise when needed. Recognising your strengths, weaknesses, and, therefore, where you need to fill any gaps is actually a mark of confidence.", "type": "text"}]}]}, {"type": "listItem", "content": [{"type": "paragraph", "content": [{"text": "The fear of hard work. ", "type": "text", "marks": [{"type": "bold"}]}, {"text": "The truth is, many people say they want to start a business, but they‚Äôre not prepared to invest the time and effort it takes to make things work. We seem to be in a culture where positive thinking has taken precedence over action. A positive attitude is important, yes, but it won‚Äôt get you there alone. You need to have a clear strategy, put consistent effort in, and regularly re-evaluate where you are and where you are going. We all have days where we feel less motivated than others, but if you believe in what you‚Äôre doing and why you‚Äôre doing it, it‚Äôs far easier to stay on track. If you‚Äôre not willing to put in the hours and make sacrifices, perhaps entrepreneurship isn‚Äôt for you.¬†", "type": "text"}]}]}]}, {"type": "paragraph", "content": [{"text": "Building your own company is a life-changing experience filled with ups and downs. You will lose things and gain so many more as you change and grow as a person, and discover what you‚Äôre really capable of. If you have the drive to make it happen, don‚Äôt waste it; you‚Äôre readier than you think you are.", "type": "text"}]}]}	\N	\N	\N	\N
26679234-bc78-4ba9-837a-ccf61c4b1d63	<p>Qlub, the ultra-fast payment system in restaurants, has become ubiquitous across Dubai‚Äôs vibrant dining scene. Following its runaway success in the UAE, Qlub has announced the closure of a $30 million funding round to take its smart dining experience global. The round was co-led by the region‚Äôs leading alternative investment firm, Shorooq, and Cherry Ventures, with major backing from strategic partners including e&amp;, Mubadala Investments, and Legend Capital.</p><p>This latest funding round underscores the growing demand for seamless, technology-driven dining experiences and positions Qlub to accelerate its global expansion, enhance its product offerings, and further integrate its solutions into the hospitality ecosystem.</p><p>"From the very beginning, we saw in Qlub more than just a payments solution‚Äîwe saw a new infrastructure for how hospitality should work in a digital-first world. Eyad and Mahmoud and the team have consistently proven that they can blend product innovation with deep market understanding, unlocking new behaviour at the intersection of tech and experience," noted Mahmoud Adi, Founding Partner at Shorooq. "We are proud to have backed Qlub from the earliest days and remain committed to supporting visionary companies redefining everyday moments across emerging markets."</p><p>Founded in 2021 by Eyad Alkassar and Mahmoud Fouz, Qlub has rapidly emerged as a pioneer in the contactless payment space, offering QR-based solutions that allow diners to view menus, place orders, and settle bills seamlessly using their smartphones. By eliminating the need for physical menus and traditional payment methods, Qlub enhances operational efficiency for restaurants and provides a frictionless experience for customers.</p><p>With a presence in thousands of establishments across many markets, including the UAE, Saudi Arabia, Singapore, Hong Kong, Australia, Brazil, Qatar, Kuwait, and Korea, Qlub has demonstrated significant traction in diverse markets. It is now processing a few billion USD annually and serves millions of customers on a monthly basis, making it the leading QR payment solution for restaurants globally.</p><p>Notable clients include Paul Cafe, Wagamama, Sushi Samba, and La Petite Maison (LPM), where the implementation of Qlub's solutions has led to strong improvements in customer satisfaction and operational efficiency. Qlub clients report a 300% increase in tips, a sevenfold increase in positive Google reviews, an 80% reduction in checkout line by streamlining the process, reducing labour costs, and decreasing the number of required cashiers by an average of a third, and an overall improvement in space utilisation by minimising the need for multiple cashier counters.</p><p>"From day one, Qlub has shown how technology can simplify and modernise hospitality. We backed them at seed and are thrilled to support them again as they scale their solution globally and change how restaurants operate," added Filip Dames, Founding Partner of Cherry Ventures. "We look forward to supporting their continued success."</p><p>The participation of industry leaders such as e&amp; and Mubadala Investments in this funding round reflects the strategic importance of Qlub's solutions in the evolving landscape of the hospitality industry.</p><p>"Qlub's innovative approach to enhancing the dining experience aligns with our commitment to supporting digital transformation in the region," said Khalifa Alshamsi, CEO of e&amp; Life. "We are excited to partner with Qlub as they continue to redefine the standards of service in the hospitality sector."</p><p>With the new funding, Qlub plans to:</p><ul><li><p>Expand its presence in existing markets and enter new regions.</p></li><li><p>Enhance its product offerings by integrating advanced analytics and insights to provide restaurants with a deeper understanding of customer behavior and preferences.</p></li><li><p>Strengthen partnerships with key players in the hospitality and technology sectors to drive further innovation and adoption of contactless payment solutions.</p></li></ul><p>‚ÄúOur vision is simple: Qlub makes paying at restaurants ten times faster‚Äîand that elevates the entire dining experience,‚Äù said Eyad Alkassar, co-founder and co-CEO of Qlub. ‚ÄúWhy would any restaurant, anywhere in the world, choose to operate without it?"</p><p>‚ÄúWe‚Äôre thrilled to have the support of investors, both new and existing partners, as we continue to build Qlub‚Äôs vision,‚Äù said Mahmoud Fouz, co-founder and co-CEO of Qlub. ‚ÄúWe‚Äôre grateful for the confidence our investors have placed in us and excited for what lies ahead.</p>	{"type": "doc", "content": [{"type": "paragraph", "content": [{"text": "Qlub, the ultra-fast payment system in restaurants, has become ubiquitous across Dubai‚Äôs vibrant dining scene. Following its runaway success in the UAE, Qlub has announced the closure of a $30 million funding round to take its smart dining experience global. The round was co-led by the region‚Äôs leading alternative investment firm, Shorooq, and Cherry Ventures, with major backing from strategic partners including e&, Mubadala Investments, and Legend Capital.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "This latest funding round underscores the growing demand for seamless, technology-driven dining experiences and positions Qlub to accelerate its global expansion, enhance its product offerings, and further integrate its solutions into the hospitality ecosystem.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "\\"From the very beginning, we saw in Qlub more than just a payments solution‚Äîwe saw a new infrastructure for how hospitality should work in a digital-first world. Eyad and Mahmoud and the team have consistently proven that they can blend product innovation with deep market understanding, unlocking new behaviour at the intersection of tech and experience,\\" noted Mahmoud Adi, Founding Partner at Shorooq. \\"We are proud to have backed Qlub from the earliest days and remain committed to supporting visionary companies redefining everyday moments across emerging markets.\\"", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "Founded in 2021 by Eyad Alkassar and Mahmoud Fouz, Qlub has rapidly emerged as a pioneer in the contactless payment space, offering QR-based solutions that allow diners to view menus, place orders, and settle bills seamlessly using their smartphones. By eliminating the need for physical menus and traditional payment methods, Qlub enhances operational efficiency for restaurants and provides a frictionless experience for customers.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "With a presence in thousands of establishments across many markets, including the UAE, Saudi Arabia, Singapore, Hong Kong, Australia, Brazil, Qatar, Kuwait, and Korea, Qlub has demonstrated significant traction in diverse markets. It is now processing a few billion USD annually and serves millions of customers on a monthly basis, making it the leading QR payment solution for restaurants globally.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "Notable clients include Paul Cafe, Wagamama, Sushi Samba, and La Petite Maison (LPM), where the implementation of Qlub's solutions has led to strong improvements in customer satisfaction and operational efficiency. Qlub clients report a 300% increase in tips, a sevenfold increase in positive Google reviews, an 80% reduction in checkout line by streamlining the process, reducing labour costs, and decreasing the number of required cashiers by an average of a third, and an overall improvement in space utilisation by minimising the need for multiple cashier counters.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "\\"From day one, Qlub has shown how technology can simplify and modernise hospitality. We backed them at seed and are thrilled to sup