t it?\\"", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "‚ÄúWe‚Äôre thrilled to have the support of investors, both new and existing partners, as we continue to build Qlub‚Äôs vision,‚Äù said Mahmoud Fouz, co-founder and co-CEO of Qlub. ‚ÄúWe‚Äôre grateful for the confidence our investors have placed in us and excited for what lies ahead.", "type": "text"}]}]}	\N	\N	\N	\N
0530a915-c85a-4ae3-aae4-b92041da300b	<p>Obsession has launched a dedicated new service helping the next generation of obsessed founders bring radical, world-changing ideas to life by unlocking bold new business breakthroughs.</p><p>What if building something extremely ambitious or seemingly impossible was no longer reserved for tech giants or billion-dollar incubators? What if your boldest idea could come to life with the right system, partners, and provocation?</p><p>That‚Äôs the question Obsession is answering with the launch of ‚ÄòThe Moonshot Challenge:‚Äô&nbsp;a dedicated new offering for founders and leaders ready to build the kind of businesses the world hasn‚Äôt seen yet.</p><p>After a year of working behind the scenes with visionary entrepreneurs, the team at Obsession noticed a pattern: while most businesses focus on incremental improvements, a rare few dare to break the mold entirely. These founders don‚Äôt need slide decks or surface-level advice‚Äîthey need a space to provoke, stretch, and shape their most ambitious thinking. That‚Äôs what led to the creation of ‚ÄòThe Moonshot Challenge‚Äô.</p><p>‚ÄúWe didn‚Äôt build this for the conventional,‚Äù said Mohamad Badr, Founder and CEO of Obsession. ‚ÄúWe created The Moonshot Challenge for those who think ten steps ahead and don‚Äôt want to play by existing rules but write their own legacy, reinvent their category, and rewire how things are done. In an age where AI evolves at lightning speed and markets shift daily, the smartest move is to stop waiting and be bold enough to leap.‚Äù</p><p><strong>So, What Is The Moonshot Challenge?</strong></p><p>The Moonshot Challenge is a highly tailored service designed for founders and teams building radical, future-facing businesses. It‚Äôs a collaborative, inside-out process that helps turn raw, ambitious ideas into fully formed concepts ready to be executed, tested, and launched.</p><p>The process is structured around a proprietary model, ‚Äò3IB‚Äô which begins with ‚ÄòInsight‚Äô through identifying the real problem worth solving, or the opportunity worth pursuing, followed by ‚ÄòIdeas<strong>‚Äô</strong> and generating a wealth of ideas that break patterns, thinking laterally, and imagining the impossible. The next step is ‚ÄòInnovation, in which participants can design a future-ready innovation portfolio with testable business models and finally ‚Äòbreakthrough‚Äô by landing a bold venture play with clear traction pathways,</p><p>Built for speed, depth, and strategic edge, The Moonshot Challenge combines future foresight, strategic provocations, rapid prototyping, and business design tools all tailored to the founder‚Äôs unique context.</p><p>‚ÄúWe saw a clear gap in the market,‚Äù Badr adds. ‚ÄúEvery company has an HR department, a finance department, a marketing department but innovation is often treated as optional. We believe it should be essential. Not just for tech companies, but for any leader who wants to grow radically and disrupt smartly.‚Äù</p><p><strong>Who‚Äôs Behind This?</strong></p><p>Founded in 2024, Obsession is led by a collective of innovation and industry experts‚Äîcurious whole-brainers who build with boldness and heart. The Moonshot Challenge is powered by a cross-disciplinary team that includes Mohamad Badr (Founder &amp; CEO), Inigo Franco (Ex-WPP), Elena Cernea (EMBA, INSEAD, Dr. Ali Ammar (Ex-J&amp;J), Andy Palanisamy (Harvard, Ex-NASA, Ex-Parsons), Tyrone Braganza (Ex HR Director, Royal Caribbean/Carnival Corporation) and Dr. Sally Hammoud (PhD in AI).</p><p>With offices in Paris, Dubai, and Mumbai, and operations across Beirut and Riyadh, Obsession works globally across sectors and categories.</p><p>The company is also supported by a powerhouse Board of Advisors with global expertise in healthcare, education, AI, design, and venture capital including Ibrahim Al Hudhaif, Dr. Halim Choueiry, Hayssam Ibrahim, Hassan Ballout, and Fran Owens all united by one shared belief: Moonshot or Nothing</p><p><strong>Why Now?</strong></p><p>Because there‚Äôs never been a better or more urgent time.</p><p>AI has lowered the barrier to execution. You no longer need a massive team to launch a product. But while the ‚Äò<em>how‚Äô</em> of building has gotten easier, the '<em>what'</em> and '<em>why'</em>&nbsp;have become exponentially more important.</p><p>In an era of automation and sameness, originality is the new unfair advantage. Whole-brain and creative thinking have become the most valuable assets and Obsession believes the time to act on them is now before the window closes.</p><p><strong>Who It‚Äôs For</strong></p><p>The Moonshot Challenge is built for founders with disruptive ideas too bold for the average business lens, investors or family offices exploring future-defining ventures, corporate leaders seeking to embed risk-taking and long-term thinking into their culture, as well as family offices ready to incubate ventures with purpose and edge and entrepreneurs pivoting from traditional businesses to original plays.<br>If your idea doesn‚Äôt quite ‚Äúfit‚Äù what‚Äôs expected, that may be the best sign it‚Äôs worth building.</p><p><strong>What‚Äôs Next?</strong></p><p>The Moonshot Challenge is now live. Obsession is selectively onboarding new projects starting this summer.</p><p>To explore if your idea is a fit, visit<a rel="nofollow" href="https://itsobsession.com/the-moonshot-challenge"> itsobsession.com/the-moonshot-challenge</a></p>	{"type": "doc", "content": [{"type": "paragraph", "content": [{"text": "Obsession has launched a dedicated new service helping the next generation of obsessed founders bring radical, world-changing ideas to life by unlocking bold new business breakthroughs.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "What if building something extremely ambitious or seemingly impossible was no longer reserved for tech giants or billion-dollar incubators? What if your boldest idea could come to life with the right system, partners, 