ment corporate governance and compliance principles in your organisation? Here are a few pointers:", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "1. Educate yourself: ", "type": "text", "marks": [{"type": "bold"}]}, {"text": "Start by familiarising yourself with the relevant laws and regulations that apply to your business. Seek out guidance from legal and compliance experts as needed.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "2. Make compliance a priority: ", "type": "text", "marks": [{"type": "bold"}]}, {"text": "While it may be tempting to focus on other aspects of the business, establishing effective governance and compliance frameworks should be a top priority from the outset.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "3. Seek out cost-effective solutions: ", "type": "text", "marks": [{"type": "bold"}]}, {"text": "Many cost-effective compliance tools and resources are available, including compliance software and online training courses.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "4. Be flexible: ", "type": "text", "marks": [{"type": "bold"}]}, {"text": "As your business grows and evolves, be prepared to adjust your governance and compliance policies and procedures. Review and modify them regularly to make sure they remain effective and you remain compliant.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "5. Strive for balance: ", "type": "text", "marks": [{"type": "bold"}]}, {"text": "Remember that compliance and innovation are not mutually exclusive. By striking a balance between the two, you can ensure that your business stays compliant while also driving growth and innovation.¬†", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "You may find it difficult to apply corporate governance and compliance principles. However, by educating yourself, prioritising compliance, looking for cost-effective solutions, being flexible, and aiming for balance, you can set up efficient governance and compliance frameworks that will support the long-term success of your business.¬†", "type": "text"}]}]}	\N	\N	\N	\N
b4e710cf-f567-4667-b19a-0063d59ecd0f	<p>International Holding Company (IHC), a global investment firm focused on creating dynamic value networks, has finalized the acquisition of eFunder, the UAE‚Äôs leading digital financing platform for small and medium-sized enterprises (SMEs). Following the acquisition, the platform has been rebranded as Zelo, marking a new phase aimed at broadening access to working capital and supporting the growth of high-potential businesses across the region.</p><p>Licensed and regulated by ADGM‚Äôs Financial Services Regulatory Authority (FSRA), Zelo has been operational since August 2020, providing SMEs with receivables-based funding. The platform enables businesses to convert approved invoices into liquidity within 24‚Äì48 hours, offering a fast, technology-driven solution to the region‚Äôs SME credit gap, which is estimated at nearly USD 250 billion across MENA.</p><p>SMEs represent over 95% of registered businesses in the UAE and contribute more than half of national GDP. However, delayed payments‚Äîoften ranging from 60 to 120 days‚Äîrestrict their growth and operational flexibility. Zelo addresses this challenge by offering seamless, automated invoice financing for key sectors, including construction, logistics, healthcare, industrial services, and oil &amp; gas.</p><p>Syed Basar Shueb, CEO of IHC, commented: ‚ÄúSMEs are the backbone of a resilient and diversified economy. Through the acquisition and rebranding of Zelo, we are enabling a platform that tackles one of the most critical barriers for SMEs: access to timely working capital. This aligns with IHC‚Äôs vision of creating smart, scalable solutions that generate meaningful economic impact.‚Äù</p><p>Dhanush Arjun, CEO of Zelo, added: ‚ÄúZelo is about removing delays‚Äîthe wait for payments, for growth, and for opportunity. With our new identity and IHC‚Äôs strategic support, we are accelerating faster, smarter access to capital for UAE SMEs.‚Äù</p><p>Zelo‚Äôs platform is designed for speed and simplicity, featuring digital onboarding, automated funding decisions, and near-instant access to capital. The system scales financing limits based on business performance, providing a flexible, frictionless experience that allows companies to reinvest in growth without cash flow interruptions.</p><p>The platform continues to be led by Zelo co-founders Dhanush Arjun (CEO) and Deepak Sekar (COO), alongside a team of experienced professionals in fintech, SME lending, and digital infrastructure. Since inception, Zelo has facilitated over 9,000 transactions, deploying more than USD 200 million in funding, demonstrating its impact and scalability within the UAE‚Äôs SME ecosystem.</p>	{"type": "doc", "content": [{"type": "paragraph", "content": [{"text": "International Holding Company (IHC), a global investment firm focused on creating dynamic value networks, has finalized the acquisition of eFunder, the UAE‚Äôs leading digital financing platform for small and medium-sized enterprises (SMEs). Following the acquisition, the platform has been rebranded as Zelo, marking a new phase aimed at broadening access to working capital and supporting the growth of high-potential businesses across the region.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "Licensed and regulated by ADGM‚Äôs Financial Services Regulatory Authority (FSRA), Zelo has been operational since August 2020, providing SMEs with receivables-based funding. The platform enables businesses to convert approved invoices into liquidity within 24‚Äì48 hours, offering a fast, technology-driven solution to the region‚Äôs SME credit gap, which is estimated at nearly USD 250 billion across MENA.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "SMEs represent over 95% of registered businesses in the UAE and contribute more than half of national GDP. However, delayed payments‚Äîoften ranging from 60 to 120 days‚Äîrestrict their growth and operational flexibility. Zelo addresses this challenge by offering seamless, automated invoice financing for key sectors, including construction, logistics, healthcare, industrial services, and oil & gas.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "Syed Basar Shueb, CEO of IHC, commented: ‚ÄúSMEs are the backbone of a resilient and diversified economy. Through the acquisition and rebranding of Zelo, we are enabling a platform that tackles one of the most critical barriers for SMEs: access to timely working capital. This aligns with IHC‚Äôs vision of creating smart, scalable solutions that generate meaningful economic impact.‚Äù", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "Dhanush Arjun, CEO of Zelo, added: ‚ÄúZelo is about removing delays‚Äîthe wait for payments, for growth, and for opportunity. With our new identity and IHC‚Äôs strategic support, we are accelerating faster, smarter access to capital for UAE SMEs.‚Äù", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "Zelo‚Äôs platform is designed for speed and simplicity, featuring digital onboarding, automated funding decisions, and near-instant access to capital. The system scales financing limits based on business performance, providing a flexible, frictionless experience that allows companies to reinvest in growth without cash flow interruptions.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "The platform continues to be led by Zelo co-founders Dhanush Arjun (CEO) and Deepak Sekar (COO), alongside a team of experienced professionals in fintech, SME lending, and digital infrastructure. Since inception, Zelo has facilitated over 9,000 transactions, deploying more than USD 200 million in funding, demonstrating its impact and scalability within the UAE‚Äôs SME ecosystem.", "type": "text"}]}]}	\N	\N	\N	\N
660b5ad7-5324-454d-a0a8-4e7e1b652f28	<p>Dubai Land Department (DLD)&nbsp;is partnering with&nbsp;Second Century Ventures&nbsp;to launch the&nbsp;REACH Middle East&nbsp;accelerator programme and has opened applications for the first cohort of companies. This landmark initiative, led by real estate technology pioneers Siddiq Farid and Karim Helal, invites startup companies from all industries to apply for the opportunity to redefine real estate innovation across the region.</p><p>REACH Middle East is a curated, eight-month programme designed to empower up to 10 high-potential startups with the tools, mentorship and networks needed to scale locally and globally within the real estate industry. Selected companies will benefit from:</p><ul><li><p><strong>Direct Funding &amp; Investment:</strong>&nbsp;REACH provides up to $250,000 seed capital per company, strategic investor introductions, and pathways for follow-on funding.</p></li><li><p><strong>Real World Access:</strong>&nbsp;Work with major real estate developers, government bodies and facility managers to pilot and commercialize solutions.</p></li><li><p><strong>Expert-Led Mentorship:</strong>&nbsp;Learn from industry veterans, successful founders and global thought leaders in PropTech.</p></li><li><p><strong>Growth Opportunities:</strong>&nbsp;Unlock curated connections at major industry events, conferences and trade shows to drive market adoption.</p></li><li><p><strong>Global Expansion:</strong>&nbsp;Plug into REACH‚Äôs exclusive global network of over 330 alumni companies.</p></li></ul><p>Aligned with the UAE Digital Economy Strategy, Dubai Economic Agenda D33 and the Dubai Real Estate Sector Strategy 2033 ‚Äì which aim to add more than $27 billion to the economy ‚Äì REACH Middle East supports the digital transformation of real estate and urban development. It complements other UAE accelerators, such as Abu Dhabi‚Äôs Hub71 and regional initiatives under the Saudi Real Estate Development Fund and NEOM Innovation Hub that align with Saudi Arabia‚Äôs Vision 2030. By fostering public-private partnerships, REACH Middle East aims to position the region as a global hub for innovation in the real estate ecosystem.</p><p>REACH is backed by Second Century Ventures, the most active global fund in real estate technology. As the strategic investment arm of the National Association of Realtors¬Æ, SCV leverages the association‚Äôs members and an unparalleled network of executives within real estate and adjacent industries.</p><p>‚ÄúWe are proud to collaborate with REACH Middle East to unlock the potential of real estate tech startups across the region. With Dubai as the starting point, this accelerator will provide unparalleled support to entrepreneurs, fostering solutions that resonate throughout the Middle East and contribute to the global real estate ecosystem,‚Äù said Dr. Mahmoud AlBurai, Head of Policies and Innovation at Dubai Land Department.</p><p>‚ÄúThe MENA region is at the forefront of real estate innovation, and REACH Middle East is committed to empowering startups to solve real-world challenges. Our programme bridges cutting-edge technology with practical real estate applications, driving sustainable growth for startups and the industry alike,‚Äù added Siddiq Farid, Managing Director of REACH Middle East.</p><p>‚ÄúREACH offers a unique opportunity for startups to be part of a transformative ecosystem. We encourage ambitious startups to apply to join the next generation of PropTech trailblazers and help shape the future of real estate in the MENA region and beyond,‚Äù said Dave Garland, Managing Partner at Second Century Ventures.</p><p>REACH Middle East seeks revenue-generating startups (seed to Series A) intent on expanding into the real estate, construction, sustainability, or property management ecosystem using emerging technologies like AI, IoT, or blockchain with scalable business models with local and global potential.</p><p>Applications are now open and can be submitted at&nbsp;<a rel="noopener noreferrer nofollow" href="https://www.nar-reach.com/middle-east">https://www.nar-reach.com/middle-east</a>. &nbsp;</p>	{"type": "doc", "content": [{"type": "paragraph", "content": [{"text": "Dubai Land Department (DLD)¬†is partnering with¬†Second Century Ventures¬†to launch the¬†REACH Middle East¬†accelerator programme and has opened applications for the first cohort of companies. This landmark initiative, led by real estate technology pioneers Siddiq Farid and Karim Helal, invites startup companies from all industries to apply for the opportunity to redefine real estate innovation across the region.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "REACH Middle East is a curated, eight-month programme designed to empower up to 10 high-potential startups with the tools, mentorship and networks needed to scale locally and globally within the real estate industry. Selected companies will benefit from:", "type": "text"}]}, {"type": "bulletList", "content": [{"type": "listItem", "content": [{"type": "paragraph", "content": [{"text": "Direct Funding & Investment:", "type": "text", "marks": [{"type": "bold"}]}, {"text": "¬†REACH provides up to $250,000 seed capital per company, strategic investor introductions, and pathways for follow-on funding.", "type": "text"}]}]}, {"type": "listItem", "content": [{"type": "paragraph", "content": [{"text": "Real World Access:", "type": "text", "marks": [{"type": "bold"}]}, {"text": "¬†Work with major real estate developers, government bodies and facility managers to pilot and commercialize solutions.", "type": "text"}]}]}, {"type": "listItem", "content": [{"type": "paragraph", "content": [{"text": "Expert-Led Mentorship:", "type": "text", "marks": [{"type": "bold"}]}, {"text": "¬†Learn from industry veterans, successful founders and global thought leaders in PropTech.", "type": "text"}]}]}, {"type": "listItem", "content": [{"type": "paragraph", "content": [{"text": "Growth Opportunities:", "