lobal fuel logistics.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "This partnership enables Fuelre4m to deliver cleaner, faster, and more efficient energy solutions to ports, maritime operators, power generators, rail systems, and public transport networks, all while aligning with global ESG goals.", "type": "text"}]}]}	\N	\N	\N	\N
fb4665c6-2db7-450c-82ed-faaaac8152f4	<p>Tech Universal Ventures (TUV), a UAE-based investment holding firm, has announced the acquisition of two high-growth technology companies‚ÄîFixSquad (UAE) and ELVA11 (Sweden)‚Äîmarking a significant move in its global expansion strategy and commitment to building digital infrastructure across core sectors.</p><p>The acquisitions are part of TUV‚Äôs vision to create a scalable network of companies delivering intelligent, future-ready services across consumer, enterprise, and education verticals.</p><p>&nbsp;</p><p><strong>About the Acquired Companies:</strong></p><ul><li><p>FixSquad:<br>A rapidly expanding mobile and electronics servicing brand with operations across the GCC, FixSquad serves both B2C and B2B segments. The company is currently launching a regional franchise model to standardise quality and scale enterprise partnerships.</p></li><li><p>ELVA11:<br>A Malm√∂- and Stockholm-based AI and software consultancy renowned for its engineering-driven culture. ELVA11 offers software development, AI consulting, and digital education services to enterprise clients across Europe."These acquisitions reflect our strategy to build and back companies delivering core infrastructure for digital growth," said Darko Atijas, COO, TUV. "<em>FixSquad anchors our regional ambitions, while ELVA11 brings deep AI capabilities aligned with the future of global software.&nbsp;</em>"With TUV‚Äôs support, we‚Äôre scaling our B2B reach and fast-tracking regional expansion," added Mohamed Rafeeque, CEO of FixSquad. "This partnership gives us the strategic depth and resources to accelerate growth and amplify client impact," said Jim Roslund, CEO and Founder of ELVA11.</p></li></ul><p>&nbsp;</p><p><strong>Strategic Impact:</strong></p><ul><li><p>Positions TUV as a regional leader in M&amp;A-driven digital transformation</p></li><li><p>Builds a cross-border portfolio focused on system integration, technology services, and education infrastructure</p></