ises, such as Hili Mall‚Äîhome to over 100 diverse retail outlets; Ayla Grand Hotel, which provides hospitality services and integrated tourist facilities. The tour also featured Bawadi Mall, which houses around 270 retail outlets offering a wide range of activities, and Al Ain Mall, owned by the Meer Group, with over 300 multi-category shops. Additional visits included.¬† Al Amaan Travel and Holidays, an affiliate of Bin Ham Group a key player in the tourism sector; and Deep Caf√©, a business that actively collaborates with over 30 local partners, reflecting a strong model of community-based commercial integration.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "The visits also included¬†", "type": "text"}, {"text": "Could Be Flower & Caf√©", "type": "text", "marks": [{"type": "italic"}]}, {"text": ", a unique concept that blends a contemporary caf√© experience with a fresh flower boutique, and¬†", "type": "text"}, {"text": "Al Narjes Nursery", "type": "text", "marks": [{"type": "italic"}]}, {"text": ", a vibrant hub that brings together a range of community-driven and productive enterprises. These include¬†", "type": "text"}, {"text": "SILO Bakery and Coffee", "type": "text", "marks": [{"type": "italic"}]}, {"text": ",¬†", "type": "text"}, {"text": "POFA Caf√©", "type": "text", "marks": [{"type": "italic"}]}, {"text": ",¬†", "type": "text"}, {"text": "Al Narjes Productive Families", "type": "text", "marks": [{"type": "italic"}]}, {"text": ",¬†", "type": "text"}, {"text": "Al Narjes Vegetables", "type": "text", "marks": [{"type": "italic"}]}, {"text": ",¬†", "type": "text"}, {"text": "Chai Jamr", "type": "text", "marks": [{"type": "italic"}]}, {"text": ", and¬†", "type": "text"}, {"text": "Al Narjes Handicrafts", "type": "text", "marks": [{"type": "italic"}]}, {"text": ", each contributing to the local economy through creativity, collaboration, and grassroots entrepreneurship.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "Through this initiative, the Abu Dhabi Chamber seeks to contribute to building a resilient and inclusive business environment and empowering entrepreneurs to achieve their ambitions for growth and competitiveness, thus enhancing the emirate's position as a vital business and investment hub.", "type": "text"}]}]}	\N	\N	\N	\N
77c31875-0d55-4cbb-a06b-b85708fdd145	<p>UAE-based tech ecosystem company Yango Group has introduced <strong>Yango Ventures</strong>, a $20 million corporate venture fund aimed at fueling the growth of innovative startups across key global markets. The fund will provide capital and strategic support to promising early-stage companies in LATAM, Sub-Saharan Africa, MENAP, and other high-potential regions.</p><p>Yango Ventures will focus on startups from <strong>Seed to Series B</strong> that are transforming the <strong>O2O (Online-to-Offline), B2B SaaS, and fintech</strong> sectors. In addition to financial investment, the fund will offer entrepreneurs access to Yango Group‚Äôs extensive expertise, global network, and market insights to help scale their businesses and create lasting economic impact.</p><p><em>"We‚Äôre not just investing in technology‚Äîwe‚Äôre investing in people and communities. Yango Ventures is an extension of our commitment to empowering entrepreneurs with the tools, knowledge, and connections they need to succeed,"</em> said <strong>Daniil Shuleyko, CEO of Yango Group</strong>. <em>"By fostering innovation in high-growth regions, we aim to support local talent and drive sustainable business expansion that benefits entire economies."</em></p><p>While initially launching with a $20 million fund, Yango Ventures is structured for scalability, with plans to expand its investment capacity in response to the evolving needs of the startup ecosystem. The fund‚Äôs goal is to <strong>promote digital transformation</strong> and support businesses that are shaping the future of fintech, mobility, entertainment, AI, and other technology-driven industries.</p><p>Backing Yango Ventures is a team of experienced professionals with a proven track record of <strong>scaling B2B SaaS and B2C technology platforms</strong> across various industries. Their expertise in building and expanding businesses globally will provide founders with critical mentorship, strategic insights, and operational guidance.</p><p>Yango Ventures is part of Yango Group‚Äôs broader initiative to drive digital transformation and <strong>strengthen local innovation ecosystems</strong>. In addition to funding startups, the company actively supports entrepreneurial communities through <strong>networking events, educational partnerships, and skill-building initiatives</strong> designed to equip future innovators with practical knowledge and industry connections.</p><p>With this latest initiative, Yango Group reaffirms its commitment to <strong>harnessing technology for global progress</strong>, helping startups turn groundbreaking ideas into scalable, impactful solutions.</p>	{"type": "doc", "content": [{"type": "paragraph", "content": [{"text": "UAE-based tech ecosystem company Yango Group has introduced ", "type": "text"}, {"text": "Yango Ventures", "type": "text", "marks": [{"type": "bold"}]}, {"text": ", a $20 million corporate venture fund aimed at fueling the growth of innovative startups across key global markets. The fund will provide capital and strategic support to promising early-stage companies in LATAM, Sub-Saharan Africa, MENAP, and other high-potential regions.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "Yango Ventures will focus on startups from ", "type": "text"}, {"text": "Seed to Series B", "type": "text", "marks": [{"type": "bold"}]}, {"text": " that are transforming the ", "type": "text"}, {"text": "O2O (Online-to-Offline), B2B SaaS, and fintech", "type": "text", "marks": [{"type": "bold"}]}, {"text": " sectors. In addition to financial investment, the fund will offer entrepreneurs access to Yango Group‚Äôs extensive expertise, global network, and market insights to help scale their businesses and create lasting economic impact.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "\\"We‚Äôre not just investing in technology‚Äîwe‚Äôre investing in people and communities. Yango Ventures is an extension of our commitment to empowering entrepreneurs with the tools, knowledge, and connections they need to succeed,\\"", "type": "text", "marks": [{"type": "italic"}]}, {"text": " said ", "type": "text"}, {"text": "Daniil Shuleyko, CEO of Yango Group", "type": "text", "marks": [{"type": "bold"}]}, {"text": ". ", "type": "text"}, {"text": "\\"By fostering innovation in high-growth regions, we aim to support local talent and drive sustainable business expansion that benefits entire economies.\\"", "type": "text", "marks": [{"type": "italic"}]}]}, {"type": "paragraph", "content": [{"text": "While initially launching with a $20 million fund, Yango Ventures is structured for scalability, with plans to expand its investment capacity in response to the evolving needs of the startup ecosystem. The fund‚Äôs goal is to ", "type": "text"}, {"text": "promote digital transformation", "type": "text", "marks": [{"type": "bold"}]}, {"text": " and support businesses that are shaping the future of fintech, mobility, entertainment, AI, and other technology-driven industries.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "Backing Yango Ventures is a team of experienced professionals with a proven track record of ", "type": "text"}, {"text": "scaling B2B SaaS and B2C technology platforms", "type": "text", "marks": [{"type": "bold"}]}, {"text": " across various industries. Their expertise in building and expanding businesses globally will provide founders with critical mentorship, strategic insights, and operational guidance.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "Yango Ventures is part of Yango Group‚Äôs broader initiative to drive digital transformation and ", "type": "text"}, {"text": "strengthen local innovation ecosystems", "type": "text", "marks": [{"type": "bold"}]}, {"text": ". In addition to funding startups, the company actively supports entrepreneurial communities through ", "type": "text"}, {"text": "networking events, educational partnerships, and skill-building initiatives", "type": "text", "marks": [{"type": "bold"}]}, {"text": " designed to equip future innovators with practical knowledge and industry connections.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "With this latest initiative, Yango Group reaffirms its commitment to ", "type": "text"}, {"text": "harnessing technology for global progress", "type": "text", "marks": [{"type": "bold"}]}, {"text": ", helping startups turn groundbreaking ideas into scalable, impactful solutions.", "type": "text"}]}]}	\N	\N	\N	\N
3d794fbd-1b18-46d5-be04-9d564e88a220	<p>Water Harvesting Inc. (WaHa) announced the close of an $8 million Series A-1 financing and corporate reorganization. The round was led by Chairman Mike Phillips and Board member Christian Thirion, with participation from WaHa‚Äôs largest noteholders and investors including Berkeley Catalyst Fund, Anthropocene Institute, Vestafund, and Mitsui Mining &amp; Smelting Co., Ltd.</p><p>This financing eliminates all debt, simplifies WaHa‚Äôs cap table, and provides capital for the company to achieve its next major commercial milestones and close its next funding round. It also supports a growing pipeline of qualified sales opportunities across the UAE and GCC, where field trials at Khalifa University have proven its unique ability to harvest pure water reliably in the UAE‚Äôs harsh desert environment of extreme heat, low moisture, and frequent sandstorms.</p><p>Since 2023, WaHa‚Äôs atmospheric water generation (AWG) systems have been deployed in challenging environments including West Texas, Abu Dhabi, a remote UAE desert site, Riyadh, and Stockholm. These systems have achieved 99.998% mechanical reliability and produced 98.3% of target water volume‚Äîthe highest sustained output in the AWG industry. The company‚Äôs 14 patent families, with 18 patents granted worldwide, protect its proprietary WaHa Vaporator¬Æ technology, a modular system supporting off-grid installations and integration with HVAC and agricultural systems.</p><p>WaHa will unveil its first commercially available AWG unit at the WETEX 2025 exhibition in Dubai (September 30 ‚Äì October 2), showcasing solutions for utilities, developers, and industrial operators seeking reliable, sustainable access to pure water.</p><p>‚ÄúWe‚Äôve built a platform capable of transforming access to water across multiple sectors,‚Äù said Mike Phillips, Chairman, WaHa. ‚ÄúThis raise will enable us to establish solid traction for the WaHa Vaporator¬Æ and improve water security in the UAE and broader GCC.‚Äù</p><p>‚ÄúWe‚Äôre grateful for the support of our investors and partners,‚Äù added Frank Ramirez, CEO of WaHa. ‚ÄúThis is a major step toward delivering water where it‚Äôs needed most‚Äîreliably, efficiently, and sustainably. We‚Äôre proud of what our team has achieved and energized for what‚Äôs ahead.‚Äù</p><p>WaHa is negotiating commercial agreements for manufacturing, distribution, and long-term service and support.</p>	{"type": "doc", "content": [{"type": "paragraph", "content": [{"text": "Water Harvesting Inc. (WaHa) announced the close of an $8 million Series A-1 financing and corporate reorganization. The round was led by Chairman Mike Phillips and Board member Christian Thirion, with participation from WaHa‚Äôs largest noteholders and investors including Berkeley Catalyst Fund, Anthropocene Institute, Vestafund, and Mitsui Mining & Smelting Co., Ltd.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "This financing eliminates all debt, simplifies WaHa‚Äôs cap table, and provides capital for the company to achieve its next major commercial milestones and close its next funding round. It also supports a growing pipeline of qualified sales opportunities across the UAE and GCC, where field trials at Khalifa University have proven its unique ability to harvest pure water reliably in the UAE‚Äôs harsh desert environment of extreme heat, low moisture, and frequent sandstorms.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "Since 2023, WaHa‚Äôs atmospheric water generation (AWG) systems have been deployed in challenging environments including West Texas, Abu Dhabi, a remote UAE desert site, Riyadh, and Stockholm. These systems have achieved 99.998% mechanical reliability and produced 98.3% of target water volume‚Äîthe highest sustained output in the AWG industry. The company‚Äôs 14 patent families, with 18 patents granted worldwide, protect its proprietary WaHa Vaporator¬Æ technology, a modular system supporting off-grid installations and integration with HVAC and agricultural systems.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "WaHa will unveil its first commercially available AWG unit at the WETEX 2025 exhibition in Dubai (September 30 ‚Äì October 2), showcasing solutions for utilities, developers, and industrial operators seeking reliable, sustainable access to pure water.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "‚ÄúWe‚Äôve built a platform capable of transforming access to water across multiple sectors,‚Äù said Mike Phillips, Chairman, WaHa. ‚ÄúThis raise will enable us to establish solid traction for the WaHa Vaporator¬Æ and improve water security in the UAE and broader GCC.‚Äù", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "‚ÄúWe‚Äôre grateful for the support of our investors and partners,‚Äù added Frank Ramirez, CEO of WaHa. ‚ÄúThis is a major step toward delivering water where it‚Äôs needed most‚Äîreliably, efficiently, and sustainably. We‚Äôre proud of what our team has achieved and energized for what‚Äôs ahead.‚Äù", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "WaHa is negotiating commercial agreements for manufacturing, distribution, and long-term service and support.", "type": "text"}]}]}	\N	\N	\N	\N
f2f1cf51-b774-46f7-9bea-96e06eb32c2d	<p>Khalifa Fund for Enterprise Development (KFED) partnered with 42 Abu Dhabi (42AD) to host the first edition of the intensive coding bootcamp, the ‚ÄòPiscine,‚Äô at Khalifa Fund Al Ain Region Campus. Running between July 14 to August 7, 2025, the collaboration is part of joint efforts to empower young talents and prepare a new generation of coders and entrepreneurs.</p><p>The Piscine is an intense and immersive bootcamp designed to equip participants with foundational coding capabilities while challenging their adaptability, problem-solving abilities, and collaboration skills. This program offers a unique opportunity for individuals, regardless of their background or prior coding experience, to build in-demand digital skills through a hands-on, peer-to-peer learning model.</p><p>The bootcamp will train 100 participants with essential coding and AI skills. With the support of Khalifa Fund for Enterprise Development, individuals from various backgrounds, including those looking to enhance their digital skills or shift into tech-focused careers, will be empowered to build new coding capabilities and actively contribute to the growing digital ecosystem. This aligns with KFED‚Äôs broader vision of advancing individual skill development and catalysing innovation-led economic growth in the region.</p><p>As part of this collaboration, participants who successfully complete the Piscine will be eligible to join 42 Abu Dhabi‚Äôs accredited program and obtain the Diploma in Software Development, which is delivered full-time at the campus in Abu Dhabi. Additionally, aspiring Emirati entrepreneurs who complete the Piscine and wish to launch their ventures can benefit from KFED‚Äôs support.</p><p>Her Excellency Mouza Al Nasri, CEO of Khalifa Fund for Enterprise Development, said: </p><blockquote><p>This collaboration between Khalifa Fund and 42 Abu Dhabi represents a pivotal step in nurturing a culture of innovation and entrepreneurship in Al Ain. By combining 42 Abu Dhabi‚Äôs groundbreaking approach to coding education with Khalifa Fund‚Äôs comprehensive support for startups, we aim to empower individuals with the requisite skills and resources to transform ideas into impactful ventures. Together, we are fostering a thriving ecosystem where talent meets opportunity, driving sustainable growth and reinforcing Abu Dhabi and the UAE‚Äôs position as a global leader in innovation and entrepreneurship.</p></blockquote><p>Khalifa Fund and 42 Abu Dhabi will continue collaborating through a range of initiatives designed to empower talents and accelerate venture creation. This includes building a seamless talent-to-startup pipeline, offering internship and employment pathways, and co-hosting community events, networking mixers, and demo days. The partnership will also include joint mentorship and training programs, equipping coders and entrepreneurs alike with the tools to materialise their ideas past conceptualisation.</p><p>Dr. Ahmed Al Shoaibi, Acting CEO of 42 Abu Dhabi, said: </p><blockquote><p>Our partnership with Khalifa Fund to bring the first-ever Piscine to the Al Ain Region is a powerful step toward widening access to innovative coding education and entrepreneurship skills. By hosting our Piscine at Khalifa Fund, Al Ain Campus, we look forward to equipping over 100 participants with in-demand coding skills and nurturing the entrepreneurial mindset needed to drive real impact within the local ecosystem. This initiative reflects 42 Abu Dhabi‚Äôs continued commitment to empowering talent across the UAE and building a robust pipeline of innovators who will contribute to the Emirate‚Äôs digital transformation.</p></blockquote><p>Potential applicants who are interested in joining the upcoming ‚ÄòPiscine‚Äô can visit 42 Abu Dhabi‚Äôs official website, where they will have to complete 42 Abu Dhabi‚Äôs pre-selection ‚ÄòGame‚Äô - an online assessment that evaluates cognitive capacity via logic and memory tests. Following this, they will attend an in-person check-in discovery session to be briefed on the Piscine and the learning methodology. Once candidates successfully complete the Piscine, they will be eligible to join the accredited Diploma in Software Development program offered at 42 Abu Dhabi‚Äôs campus in Abu Dhabi.</p>	{"type": "doc", "content": [{"type": "paragraph", "content": [{"text": "Khalifa Fund for Enterprise Development (KFED) partnered with 42 Abu Dhabi (42AD) to host the first edition of the intensive coding bootcamp, the ‚ÄòPiscine,‚Äô at Khalifa Fund Al Ain Region Campus. Running between July 14 to August 7, 2025, the collaboration is part of joint efforts to empower young talents and prepare a new generation of coders and entrepreneurs.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "The Piscine is an intense and immersive bootcamp designed to equip participants with foundational coding capabilities while challenging their adaptability, problem-solving abilities, and collaboration skills. This program offers a unique opportunity for individuals, regardless of their background or prior coding experience, to build in-demand digital skills through a hands-on, peer-to-peer learning model.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "The bootcamp will train 100 participants with essential coding and AI skills. With the support of Khalifa Fund for Enterprise Development, individuals from various backgrounds, including those looking to enhance their digital skills or shift into tech-focused careers, will be empowered to build new coding capabilities and actively contribute to the growing digital ecosystem. This aligns with KFED‚Äôs broader vision of advancing individual skill development and catalysing innovation-led economic growth in the region.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "As part of this collaboration, participants who successfully complete the Piscine will be eligible to join 42 Ab