the Al Ain Region is a powerful step toward widening access to innovative coding education and entrepreneurship skills. By hosting our Piscine at Khalifa Fund, Al Ain Campus, we look forward to equipping over 100 participants with in-demand coding skills and nurturing the entrepreneurial mindset needed to drive real impact within the local ecosystem. This initiative reflects 42 Abu Dhabi‚Äôs continued commitment to empowering talent across the UAE and building a robust pipeline of innovators who will contribute to the Emirate‚Äôs digital transformation.", "type": "text"}]}]}, {"type": "paragraph", "content": [{"text": "Potential applicants who are interested in joining the upcoming ‚ÄòPiscine‚Äô can visit 42 Abu Dhabi‚Äôs official website, where they will have to complete 42 Abu Dhabi‚Äôs pre-selection ‚ÄòGame‚Äô - an online assessment that evaluates cognitive capacity via logic and memory tests. Following this, they will attend an in-person check-in discovery session to be briefed on the Piscine and the learning methodology. Once candidates successfully complete the Piscine, they will be eligible to join the accredited Diploma in Software Development program offered at 42 Abu Dhabi‚Äôs campus in Abu Dhabi.", "type": "text"}]}]}	\N	\N	\N	\N
059da279-dd5f-4e76-a1b2-0728f744b3e4	<p>Cross-border e-commerce platform Desertcart&nbsp;has expanded its global sourcing network to include South Korea and Japan. With this move, Desertcart has added over 10 million new products to its platform‚Äîgiving customers across the GCC and beyond access to two of the world‚Äôs most in-demand markets for beauty, electronics, home, and wellness goods.</p><p>‚ÄúKorea and Japan are global powerhouses when it comes to innovation, quality, and cult-favorite products,‚Äù said Rahul Swaminathan, CEO of Desertcart, in a statement. ‚ÄúOur goal has always been to bring the world‚Äôs best products closer to our customers. This expansion is a big step forward in that mission.‚Äù</p><p>The timing aligns with powerful consumer trends: K-Beauty is expected to grow from $14.7 billion in 2024 to $32 billion by 2033, at a CAGR of over 9%, driven by global demand for innovative skincare and cosmetics. Meanwhile, the prestige beauty market in the GCC is growing at 10% year-on-year, reflecting increased spending on premium wellness and personal care. In parallel, Japanese exports to the UAE reached $13 billion, with particularly high demand for consumer electronics, home appliances, and niche wellness products.</p><p>With direct sourcing from Korea and Japan, Desertcart now offers faster delivery, better pricing, and expanded access to products that were previously difficult to find or overpriced in the region.</p><p>With Korea and Japan now added to its sourcing portfolio, the company delivers to over 100 countries, reinforcing its position as the region‚Äôs most comprehensive cross-border e-commerce platform.</p><p>‚ÄúOur expansion into sourcing from Korea and Japan is a strategic response to the accelerating demand we're witnessing in the GCC,‚Äù said Miquel Pancorbo, COO of Desertcart. ‚ÄúBy introducing over 10 million new items from these regions, we're not only diversifying our product offerings but also aligning with these significant market trends to better serve our customers. We‚Äôre giving our customers front-row access to global trends.‚Äù</p>	{"type": "doc", "content": [{"type": "paragraph", "content": [{"text": "Cross-border e-commerce platform Desertcart¬†has expanded its global sourcing network to include South Korea and Japan. With this move, Desertcart has added over 10 million new products to its platform‚Äîgiving customers across the GCC and beyond access to two of the world‚Äôs most in-demand markets for beauty, electronics, home, and wellness goods.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "‚ÄúKorea and Japan are global powerhouses when it comes to innovation, quality, and cult-favorite products,‚Äù said Rahul Swaminathan, CEO of Desertcart, in a statement. ‚ÄúOur goal has always been to bring the world‚Äôs best products closer to our customers. This expansion is a big step forward in that mission.‚Äù", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "The timing aligns with powerful consumer trends: K-Beauty is expected to grow from $14.7 billion in 2024 to $32 billion by 2033, at a CAGR of over 9%, driven by global demand for innovative skincare and cosmetics. Meanwhile, the prestige beauty market in the GCC is growing at 10% year-on-year, reflecting increased spending on premium wellness and personal care. In parallel, Japanese exports to the UAE reached $13 billion, with particularly high demand for consumer electronics, home appliances, and niche wellness products.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "With direct sourcing from Korea and Japan, Desertcart now offers faster delivery, better pricing, and expanded access to products that were previously difficult to find or overpriced in the region.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "With Korea and Japan now added to its sourcing portfolio, the company delivers to over 100 countries, reinforcing its position as the region‚Äôs most comprehensive cross-border e-commerce platform.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "‚ÄúOur expansion into sourcing from Korea and Japan is a strategic response to the accelerating demand we're witnessing in the GCC,‚Äù said Miquel Pancorbo, COO of Desertcart. ‚ÄúBy introducing over 10 million new items from these regions, we're not only diversifying our product offerings but also aligning with these significant market trends to better serve our customers. We‚Äôre giving our customers front-row access to global trends.‚Äù", "type": "text"}]}]}	\N	\N	\N	\N
