COPY public.narratives (id, insight_pack_id, what, why, next, updated_at, created_at, template_code) FROM stdin;
37903905-7c86-43bd-b7a9-c42aa92402e1	4457142e-3eb9-41d4-bd17-b262cc8fc0aa	Ecosystem engagement strengthened significantly with 127 active partner organizations (up 28.3%). Referral quality score reached 7.8/10, indicating high-value partnerships generating qualified applicants. Sentiment analysis across social media, news, and forums shows 82.5/100 positive sentiment index. Earned media mentions surged to 156 (up 42.7%), with coverage focusing on program success stories and economic impact.	Partner ecosystem growth driven by structured co-creation workshops, quarterly partner summits, and shared success metrics. High referral quality stems from partner training on program criteria and ideal candidate profiles. Positive sentiment reflects transparent communication, entrepreneur success stories shared widely, and responsive handling of feedback. Media interest increased due to proactive PR highlighting job creation impact (4,823 jobs) and innovation achievements.	Ecosystem expansion strategy: 1) Launch Partner Portal with real-time referral tracking and incentive dashboard, 2) Expand network to 150 partners by onboarding international accelerators and VCs, 3) Implement Partner Excellence Awards to recognize top referrers, 4) Create co-branded content series with key partners (Hub71, ADGM) showcasing success stories, 5) Deploy sentiment monitoring AI to identify and address concerns within 24 hours, targeting 85+ sentiment score by year-end.	2025-10-13 13:16:46.5865+00	2025-10-13 13:16:46.5865+00	\N
5661e94b-8254-4561-8ec5-77a5f0172020	b1f9d96f-b922-4f8b-a4c5-0ee65b053bae	Partner performance remains strong with 94% SLA compliance and consistent quality scores of 4.7/5. Collaboration frequency has increased to 12 touchpoints per month.	Regular partnership reviews and improved communication channels are maintaining high performance standards across the partner ecosystem.	\N	2025-10-13 13:17:10.371236+00	2025-10-13 13:17:10.371236+00	\N
97ca5f55-d12b-4e0a-bf75-7eec1e98a4e6	b741ea3d-92a9-4d93-930f-c10dd65c009a	Policy communication remains active with 8 updates this period. Guidance views have grown to 2,450, and FAQ resolution effectiveness is at 85%.	Clear communication of policy changes and comprehensive FAQ resources are helping stakeholders understand and comply with updated requirements.	\N	2025-10-13 13:17:17.345919+00	2025-10-13 13:17:17.345919+00	\N
e859af9a-c3f3-4099-a266-62b47fddc426	d9b02112-07b4-409e-bb2e-910f9108e8e4	Partner engagement is showing positive momentum with NPS increasing to 68 and portal usage reaching 82%. Enablement program completion rates have improved significantly.	Recent improvements to the partner portal UX and personalized enablement tracks are driving higher engagement and satisfaction scores.	\N	2025-10-13 13:17:05.758561+00	2025-10-13 13:17:05.758561+00	\N
a3fc899a-5efc-4035-a2f1-57e79a2a0658	81864a0a-703b-4eca-9ddb-8dd88f2f0cd5	Joint service delivery metrics show improvement with median review time down to 3.5 days and 88% on-time resolution. Open pipeline has been reduced to 45 items.	Streamlined collaboration workflows and clearer handoff processes between teams are accelerating service delivery timelines.	\N	2025-10-13 13:17:12.702454+00	2025-10-13 13:17:12.702454+00	\N
e1fa079b-67d5-4717-bffd-42ddf535059f	0881bad1-d42a-4bef-91c0-5bf4e8ed2417	Service delivery performance reached new highs with 94.3% SLA compliance, exceeding target by 4.3%. First response time improved dramatically to 2.8 hours (down from 3.6 hours), and average resolution time dropped to 1.8 days. Backlog reduced by 35.6% to just 47 tickets, while ticket reopen rate decreased to 8.5%, indicating higher quality resolutions on first attempt.	Improvements driven by AI-powered ticket routing reducing misdirection by 40%, expanded support team with Arabic language specialists, and comprehensive knowledge base reducing common queries. Implementation of chatbot for tier-1 questions deflected 30% of routine inquiries. Agent training on common application issues improved first-contact resolution rate from 68% to 82%.	Service enhancement plan: 1) Deploy predictive ticket prioritization to maintain sub-3-hour response time, 2) Expand self-service knowledge base with video tutorials in Arabic and English, 3) Implement proactive outreach for applications stalled >7 days, 4) Launch agent performance dashboard with real-time coaching, 5) Integrate WhatsApp Business API for faster entrepreneur support, targeting 95% SLA compliance by Q2 2025.	2025-10-13 13:16:41.305537+00	2025-10-13 13:16:41.305537+00	\N
bb45213d-29d5-45aa-bb2b-09531e7caef6	44431a9d-c6df-46a1-b6e0-8545a9971cd0	Q4 2024 shows exceptional program performance with 1,247 SMEs supported, exceeding our target by 4%. The 12-month survival rate reached 87.3%, up 3.2% from last quarter, indicating strong program quality. Our entrepreneurs created 4,823 new jobs, surpassing the target by 7%. Time to first funding improved significantly, dropping to 42 days from 48 days last quarter.	Strong outcomes stem from three key improvements: enhanced mentorship programs paired with funding, faster application processing through digital transformation, and targeted sector focus on high-growth industries (tech, sustainability, healthcare). The survival rate improvement reflects better entrepreneur selection criteria and post-funding support programs. Job creation exceeds projections due to successful scaling of tech startups.	Q1 2025 priorities: 1) Launch AI-powered application screening to reduce processing time to 35 days, 2) Expand mentorship network to 500+ experts across UAE, 3) Introduce sector-specific accelerator tracks for tech and green economy startups, 4) Implement real-time impact tracking dashboard for entrepreneurs to monitor their progress and access resources proactively.	2025-10-13 13:16:33.388584+00	2025-10-13 13:16:33.388584+00	\N
4ed225b3-eb8b-405a-a348-b850c63f5847	5b8487c5-513b-4c65-879d-51bc134090c6	Platform engagement reached all-time highs with 8,947 MAU (up 24.3%) and a healthy 42.8% DAU/MAU ratio indicating strong daily engagement. Journey completion rate improved to 68.5%, while drop-off rate decreased to 14.2%. Authenticated users grew to 6,823, with 56.2% returning for multiple sessions, demonstrating strong user retention and platform value.	Improvements driven by UX redesign completed in Q3, personalized onboarding flows, and mobile app optimization. The addition of application status tracking and milestone notifications reduced uncertainty and improved completion rates. Social media campaigns expanded reach by 28%, while referral programs contributed 22% of new users, indicating strong word-of-mouth growth.	Focus areas: 1) Launch personalized dashboard with AI-powered recommendations to increase DAU/MAU to 50%, 2) Implement in-app chat support to reduce drop-offs to 10%, 3) Expand mobile app features for document upload and e-signature to improve completion rates to 75%, 4) Roll out community forums to increase repeat visits and peer-to-peer knowledge sharing.	2025-10-13 13:16:36.032522+00	2025-10-13 13:16:36.032522+00	\N
5f3de128-9200-4f5f-9d91-a4ca8b1333a4	c20e2584-07a4-41cd-ab82-fb4d04e17b06	Customer sentiment metrics are trending positively with NPS at 72 and CSAT at 4.6/5. Journey completion rates have improved to 78%.	Enhanced self-service capabilities and streamlined application processes are contributing to better customer experiences and higher satisfaction.	\N	2025-10-13 13:17:08.083167+00	2025-10-13 13:17:08.083167+00	\N
813d4677-88ee-4939-9414-e3c7475b3e09	6788dd5d-837f-4b51-a58a-540abef94c75	Technology sector maintains 32% of portfolio. Regional inclusion index has improved to 0.78, and average time to start has decreased to 45 days.	Focused outreach to underserved regions and process improvements are contributing to better regional balance and faster startup velocity.	\N	2025-10-13 13:17:15.072656+00	2025-10-13 13:17:15.072656+00	\N
aa9cf7b6-09c1-4860-b70c-e1af402afd95	646beb1b-62f6-47f7-9048-d1992e377138	Application funnel performance improved across all stages. Visit-to-start conversion reached 68.2%, while start-to-submit improved significantly to 42.5% (up from 37.8%). Submit-to-approve rate stands at 68.5%, and approve-to-fund maintains excellent performance at 92.8%. Median processing time decreased to 8.5 days, beating our 10-day target by 15%.	Enhanced funnel performance stems from simplified application forms (reduced from 45 to 28 questions), real-time validation preventing submission errors, and automated document verification. The document upload stage saw the biggest improvement due to mobile app integration and WhatsApp document submission. Review time decreased through AI-assisted preliminary screening and parallel review workflows.	Optimization roadmap: 1) Implement AI pre-qualification chatbot to improve visit-to-start by 10%, 2) Launch smart form auto-fill using Emirates ID to boost start-to-submit to 50%, 3) Deploy predictive approval scoring to identify high-potential applications early, 4) Reduce review stage from 12.8 to 8 days through enhanced automation and reviewer training, 5) Create fast-track pathway for returning entrepreneurs.	2025-10-13 13:16:38.649503+00	2025-10-13 13:16:38.649503+00	\N
6c71d88a-3e4c-490f-80a3-dac00c1a9d81	4fc59411-6555-4f9d-a2dc-6bb6b390c248	Q2 2024 outreach efforts achieved exceptional results with campaign reach of 285,000 (up 32.5%), generating 682 applications. Click-through rate improved to 4.8%, while cost per application dropped to 142 AED, a 22.8% improvement. Event-to-application conversion reached 28.5%, with referral applications surging to 487 (+45.2%), indicating strong program reputation and word-of-mouth growth.	Success factors include targeted social media campaigns leveraging success stories in Arabic and English, strategic partnerships with universities and incubators, and high-impact events like Startup Weekend Abu Dhabi. Referral program incentives (mentorship hours, fast-track review) drove 45% growth. Content marketing strategy focused on entrepreneur testimonials increased engagement by 60% versus generic content.	Scale and optimize: 1) Launch TikTok and Snapchat campaigns targeting Gen-Z entrepreneurs (18-25), 2) Expand influencer partnerships with 20 UAE-based entrepreneur influencers, 3) Create sector-specific webinar series (tech, F&B, retail) to drive qualified leads, 4) Implement attribution modeling to optimize budget allocation across channels, 5) Pilot community ambassador program in universities, targeting 50% increase in student applications by Q4 2024.	2025-10-13 13:16:43.964278+00	2025-10-13 13:16:43.964278+00	\N
